import React from 'react';
import { Graphviz } from 'graphviz-react';

function GraphVisualization({ routes }) {
  const dotString = `
    digraph G {
      ${routes.map(route => `${route.start} -> ${route.end} [label="${route.distanceInKm} km"]`).join('\n')}
    }
  `;

  return (
    <div>
      <h2>All Routes Graph</h2>
      <Graphviz dot={dotString} />
    </div>
  );
}

export default GraphVisualization;
